export default function Home() {
  return (
    <section className="flex flex-col items-center justify-center min-h-[80vh] text-center px-4">
      <h1 className="text-4xl md:text-6xl font-bold mb-4">Hi, I'm Your Name</h1>
      <p className="text-lg md:text-xl text-gray-600 max-w-xl">
        A passionate front-end developer & UI/UX designer crafting digital experiences with React and Tailwind.
      </p>
    </section>
  );
}
